INSERT INTO `education_news` (`id`, `school_id`, `news_cat_id`, `add_by_id`, `title`, `description`, `app_notification`, `publish_date_time`, `text`, `link`, `youtubeLink`, `date`, `image`, `status`, `rank`, `time`) VALUES
(17, 8, 8, 0, 'Education: Sugar Danger', 'Fructose Sugar: This Addictive Commonly Used Food, Feeds Cancer \r\nCells, Triggers Weight Gain, and Promotes Premature Aging.', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '5[2].jpg', 'active', 2, 1399383529),
(18, 8, 8, 0, 'Education: Does vitamine C fight cancer?', 'Vitamin C is found in many vegetables and fruits, especially \r\noranges, grapefruits, and peppers. Many studies have shown a \r\nlink between eating foods rich in vitamin C, such as fruits and vegetables, and a reduced risk of cancer. On the other hand, the \r\nfew studies in which vitamin C has been given as a supplement \r\nhave not shown a reduced cancer risk.', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '4[1].jpg', 'active', 3, 1399383529),
(19, 8, 12, 0, 'Education: Etiquette for children', 'Excuse Me   This is a valuable phrase that is used too little. Besides saying \r\n“excuse me” after public bodily functions there are many other times when \r\n“excuse me” should be used. Such as when a person walks through a \r\ncrowded room, bumps into someone, walks in front of someone, needs to \r\nleave a group, or needs to ask a question.', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '1[2].jpg', 'active', 4, 1399383529),
(20, 8, 14, 0, 'Education: The Golden Rule of Parenting', 'Always be the kind of person you want your kids to be. So, if \r\nyou want your kids to be respectful, considerate and honest, you \r\nhave to be respectful, considerate and honest. And, then you may \r\nexpect that behavior from your kids.', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '1[1].jpg', 'active', 5, 1399383529),
(21, 8, 14, 0, 'Education: Telephone Manners', 'When calling a friend, identify yourself to the person who answers \r\nthe phone before asking to speak your friend. By doing so, the \r\nparents or other family member who answer the phone will \r\nappreciate this courtesy and see you as friendly.', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '3[1].jpg', 'active', 6, 1399383529),
(22, 8, 10, 0, 'Education: Smoking effect on pregnancy', 'Exposure to maternal smoking not only during pregnancy, but also \r\nat early childhood, showed long–term negative effect on height of \r\nchildren until adolescence', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '5[1].jpg', 'active', 7, 1399383529),
(23, 8, 10, 0, 'Education: How to increase kids immune system', 'a)  Serve more fruits and vegetables \r\nb)  Boost sleep time \r\nc)  Breast-feed your baby \r\nd)  Exercise as a family \r\ne)  Guard against germ spread \r\nf)  Feed your child less sugar and other sweeteners', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '7.jpg', 'active', 8, 1399383529),
(24, 8, 10, 0, 'Education: How to protect your babies form flu?', 'Keep yourself and your baby away from people who are sick, as \r\nmuch as you can. \r\nCover your nose and mouth with a tissue when you cough or \r\nsneeze—throw the tissue away after you use it. \r\nWash your hands often with soap and water, especially after you\r\ncough or sneeze. If you are not near water, use an alcohol-based \r\nhand cleaner. \r\nTry not to touch your eyes, nose, or mouth. Germs often spread \r\nthis way.', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '6.jpg', 'active', 9, 1399383529),
(25, 8, 9, 0, 'Education: Selfie', 'A recent study found that the selfie phenomenon may be \r\ndamaging to real world relationships, and that increased \r\nfrequency of sharing self-portraits is related to a decrease in \r\nintimacy with others', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '5.jpg', 'active', 10, 1399383529),
(26, 8, 9, 0, 'Education: Autism', 'Autism usually manifests by age two. It affects far more males \r\nthan females. The frequency of diagnosis has surged over the past \r\n20 years. No one knows for sure what causes autism, but \r\nnumerous studies link it to advanced maternal and/or paternal \r\nage at conception', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '4.jpg', 'active', 11, 1399383690),
(27, 8, 9, 0, 'Education: Anxiety', 'Generally, anxiety arises first, often during childhood. Evidence suggests \r\nthat both biology and environment can contribute to the disorder. Some \r\npeople may have a genetic predisposition to anxiety; however, this does \r\nnot make development of the condition inevitable', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '3.jpg', 'active', 12, 1399383690),
(16, 8, 8, 0, 'Education: Water benefits', 'Water accounts for approximately two-thirds of the human \r\nbody and is responsible for the proper functioning of many \r\nhealth systems needed for survival, including the brain.  \r\n70% of the earth is water - but less than 1% is drinkable.', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '6[1].jpg', 'active', 1, 1399383529),
(193, -1, 22, 0, 'Warp Speed', '', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'Warp_Speed.jpg', 'active', 116, 1415116987),
(112, -1, 8, 0, 'Dietician', 'تناول البروتين باستمرار و أداء الرياضه يجعلك تحافظ علي عظامك. كما أنه يمنع هشاشة العظام في وقت لاحق في الحياتك', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 67, 1404251889),
(33, 20, 8, 0, 'new news', 'تناول البروتين باستمرار و أداء الرياضه يجعلك تحافظ علي عظامك. كما أنه يمنع هشاشة العظام في وقت لاحق في الحياتك. \r\nReference:\r\nChevalley, T., Bonjour, J.,  Rietbergen, B., Ferrari, S.&amp;   Rizzoli, R. (2014). .Tracking of environmental determinants of bone structure and strength development in healthy boys: An eight-year follow up study on the positive interaction between physical activity and protein intake from pre-puberty to mid-late adolescence. Osteoporosis, 25, 2.\r\nامهات:', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 18, 1402089807),
(34, 20, 6, 0, 'important news', ':\r\nعدم الحركه و استخدام وسائل الاعلام الالكترونيه بكثره يزيد من التعرض لأحداث القلب والأوعية الدموية والسكري في الأطفال 6-8 سنوات من العمر.لذلك يجب تحفيز الاطفال علي الرياضه و الارشاد في أستخدام وسائل الاعلام الالكترونيه.\r\nReference:\r\nJuuso Väistö, J. et al (2014).  Physical activity and sedentary behaviour in relation to cardiometabolic risk in children: cross-sectional findings from the Physical Activity and Nutrition in Children (PANIC) Study.  International Journal of Behavioral Nutrition and Physical Activity. \r\n--------', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 19, 1402089948),
