(184, -1, 19, 0, 'University of Toronto: Nanotechnology', 'Prof. Warren Chan, University of Toronto: Nanotechnology Approaches to the Treatment of Cancer\r\n \r\nIn this video Prof. Warren Chan, from the Institute of Biomaterials and Biomedical Engineering at the University of Toronto, discusses his work designing nanoparticles to deliver drugs specifically to tumor sites. Warren explains the advantages of using therapeutic nanoparticles for the treatment of cancer and tells Select Science about the technologies that are enabling this research.\r\n\r\nhttp://www.selectscience.net/SelectScience-TV/Videos/prof-warren-chan,-university-of-toronto--nanotechnology-approaches-to-the-treatment-of-cancer/?&amp;videoID=1465', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 107, 1415114194),
(113, -1, 9, 0, 'Psychology', 'يجب ان تقلل من مشاهده وسائل الاعلام لانها تؤثر سلبا علي صحتك. حاول ان تجعلها عاده دائمه من الصغر', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '10[3].jpg', 'active', 68, 1404252743),
(117, -1, 18, 0, 'For Mothers', 'الامهات:\r\nعدم الحركه و استخدام وسائل الاعلام الالكترونيه بكثره يزيد من التعرض لأحداث القلب والأوعية الدموية والسكري في الأطفال 6-8 سنوات من العمر.لذلك يجب تحفيز الاطفال علي الرياضه و الارشاد في أستخدام وسائل الاعلام الالكترونيه.\r\nReference:\r\nJuuso Väistö, J. et al (2014).  Physical activity and sedentary behaviour in relation to cardiometabolic risk in children: cross-sectional findings from the Physical Activity and Nutrition in Children (PANIC) Study.  International Journal of Behavioral Nutrition and Physical Activity.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 69, 1404421166),
(118, 22, 12, 0, 'sports', 'Important Match between France and Germany on Friday 4th of July at 19:00', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 70, 1404421383),
(119, 22, 9, 0, 'Media', 'يجب ان تقلل من مشاهده وسائل الاعلام لانها تؤثر سلبا علي صحتك. حاول ان تجعلها عاده دائمه من الصغر.\r\nReference:\r\nAmerican Academy of Pediatrics (2014). Fussy infants and toddlers tend to watch more media starting a lifelong habit.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 71, 1404680514),
(120, -1, 9, 0, 'Psychology News', '-Eye contact occurs very early in development and serves many functions for the young child. It has been implicated in the development of social, cognitive, and language skills. A substantial number of children with autism fail to develop this important skill and therefore experimenters with both develop- mental and behavior analytic perspectives have researched methods to teach eye contact.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 72, 1406626668),
(185, -1, 25, 0, 'Universities Ranking', 'The Times Higher Education World University Rankings 2014-2015 list the best global universities and are the only international university performance tables to judge world class universities across all of their core missions - teaching, research, knowledge transfer and international outlook. The top universities rankings employ 13 carefully calibrated performance indicators to provide the most comprehensive and balanced comparisons available, which are trusted by students, academics, university leaders, industry and governments.\r\n\r\nhttp://www.timeshighereducation.co.uk/world-university-rankings/2014-15/world-ranking?gclid=CjwKEAiAj-KiBRC48YzhnLSg0D0SJAClOhK3feo9VeOXCI758_zrOw39PKgPZtFRSMT1WeTjEfutPhoCtCDw_wcB', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 108, 1415114677),
(122, -1, 8, 0, 'Dietetic News', '-	Did you know that eating Breakfast regularly tend to make your children more alert in school and by this they are less expected to be overweight than kids who regularly skip breakfast?', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '9[2].jpg', 'active', 74, 1406626759),
(101, -1, 8, 0, 'Fruits and vegetables', 'تعريض الأطفال إلى الخضار الجديد في وقت مبكر من الحياة تشجعهم على تناول المزيد منه مقابل تقديم الخضروات مقارنه للأطفال الأكبر سنا. لذلك شجعي طفلك علي تناول الخضروات من سن مبكر.\r\nReference: \r\nCaton, S. et al (2014) Learning to Eat Vegetables in Early Life: The Role of Timing, Age and Individual Eating Traits. Plos one, 9,5.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '6[2].jpg', 'active', 63, 1403730706),
(121, -1, 9, 0, 'Psychology', 'Lenfant ne comprendra pas une brusquerie suivie d’une embrassade. Parler est toujours préférable aux empoignes, que ce soit de colère ou de tendress; lesquelles sont animals qu’humaines.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '1[3].jpg', 'active', 73, 1406626668),
(111, -1, 26, 0, 'Pediatric News', 'عدم الحركه و استخدام وسائل الاعلام الالكترونيه بكثره يزيد من التعرض لأحداث القلب والأوعية الدموية والسكري في الأطفال 6-8 سنوات من العمر.لذلك يجب تحفيز الاطفال علي الرياضه و الارشاد في أستخدام وسائل الاعلام الالكترونيه.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 66, 1404251460),
(123, -1, 10, 0, 'Pediatric News', '1)	A broken bone requires emergency medical care. Your child might have a broken (fractured) bone if he or she heard or felt a bone snap, has difficulty moving the injured part, or if the injured part moves in an unnatural way or is very painful to the touch', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '9[1].jpg', 'active', 75, 1406626874),
(124, -1, 10, 0, 'Pediatric News', '2)	When Should Kids Start Playing Sports?\r\nAs you think about signing kids up for sports, consider how emotionally and physically ready they are to participate. Signing up too early can end up being frustrating for everyone, and can turn kids off from sports for good.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '9.jpg', 'active', 76, 1406626874),
(125, -1, 6, 0, 'Savoir Vivre', 'when calling a friend; identify yourself to the person who answers the phone before asking to speak your friend. By doing so, the parents or other family member who answer the phone will appreciate this courtesy and see you as friendly', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '4.jpg', 'active', 77, 1406627007),
(126, -1, 6, 0, 'Savoir Vivre', 'when you are in school; be cool by making a point to talk with that new kid in your class. If the tables were turned, wouldn&#039;t that make you feel good?', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '10[2].jpg', 'active', 78, 1406627007),
(133, -1, 14, 0, 'Telescope', 'The first Telescope appeared in Netherlands in October 1608', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '7[2].jpg', 'active', 85, 1408786355),
