(130, -1, 11, 0, 'Important news', 'عدم الحركه و استخدام وسائل الاعلام الالكترونيه بكثره يزيد من التعرض لأحداث القلب والأوعية الدموية والسكري في الأطفال 6-8 سنوات من العمر.لذلك يجب تحفيز الاطفال علي الرياضه و الارشاد في أستخدام وسائل الاعلام الالكترونيه.\r\nReference:\r\nJuuso Väistö, J. et al (2014).  Physical activity and sedentary behaviour in relation to cardiometabolic risk in children: cross-sectional findings from the Physical Activity and Nutrition in Children (PANIC) Study.  International Journal of Behavioral Nutrition and Physical Activity. \r\n---------', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '10.jpg', 'active', 82, 1407314433),
