(167, -1, 8, 0, 'Sugary soda linked to cell aging', 'Sugar-sweetened soda consumption might promote disease independently from its role in obesity, according to UC San Francisco researchers who found in a new study that drinking sugary drinks was associated with cell aging.\r\n\r\nRead More : http://www.universityofcalifornia.edu/news/sugary-soda-linked-cell-aging', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'so.jpg', 'active', 90, 1414866717),
(168, -1, 26, 0, 'How the lungs fight the flu virus', 'A special type of phagocyte cells in the lungs plays an important role during infection with flu viruses by preserving the exchange of oxygen and carbon dioxide despite massive virus-induced lung tissue damage, as researchers from ETH have demonstrated.\r\n\r\nRead More : https://www.ethz.ch/en/news-and-events/eth-news/news/2014/10/how-the-lungs-fight-the-flu-virus.html', '', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'image.imageformat.fullwidth.1620339384.png', 'active', 91, 1414867730),
(169, -1, 9, 0, 'Curiosity: It Helps Us Learn, But Why?', 'What, exactly, is curiosity and how does it work? A study published in the October issue of the journal Neuron suggests that the brain&#039;s chemistry changes when we become curious, helping us better learn and retain information.\r\nRead More : http://www.npr.org/blogs/ed/2014/10/24/357811146/curiosity-it-may-have-killed-the-cat-but-it-helps-us-learn', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'curiosity_.jpg', 'active', 92, 1414868166),
(170, -1, 26, 0, 'New technology shows nurses where your veins are', 'If you’ve ever given blood, you’ve likely experienced the discomfort of having a nurse struggle to find your vein. And if you’re anything like me, you’re probably used to someone jabbing at your arm for five minutes before giving up and moving to the other one because your veins are &quot;difficult to find&quot;.\r\nBut don&#039;t worry, this device is about to make the process a whole lot less painful.\r\n\r\nLink to article : http://www.sciencealert.com.au/news/20143010-26427.html', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'IMG_0440_web.jpg', 'active', 93, 1414868413),
(171, -1, 16, 0, 'Link the European Space Agency to Your School', 'ESA Education is proud to present  ‘Teach with Rosetta,’ a new dedicated website filled with information, classroom resources and student activities that link school sciences to Rosetta, ESA’s historic mission to comet 67P/Churyumov- Gerasimenko.\r\n\r\nCheck the Video section : http://www.esa.int/spaceinvideos/Videos/2014/10/Cooking_a_comet_ingredients_for_life_-_classroom_demonstration_video_VP06', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'Cooking_a_comet-estec_open_day_node_full_image_2.jpg', 'active', 94, 1414868587),
(172, -1, 22, 0, 'Future of the universe', 'New research offers a novel insight into the nature of dark matter and dark energy and what the future of our Universe might be.\r\nResearchers in Portsmouth and Rome have found hints that dark matter, the cosmic scaffolding on which our Universe is built, is being slowly erased, swallowed up by dark energy.\r\n\r\nLink to article : http://www.icg.port.ac.uk/category/news/', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'Dark_matter_Nasa.jpg', 'active', 95, 1414868925),
(173, -1, 19, 0, 'Cybernetics : The biological meets the technological', 'University of Reading has been working on developing neural networks that can control machines .Such machines can become self learning .\r\nThis field of research that brings together the biological and the technological is called Cybernetics and it is a growing field in many parts of the world .\r\n\r\nLink to Article : http://singularityhub.com/2010/10/06/videos-of-robot-controlled-by-rat-brain-amazing-technology-still-moving-forward/#\r\nSee Video in Video Section\r\nLink to Video : http://www.youtube.com/watch?v=1-0eZytv6Qk', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'rat-brain-robot.jpg', 'active', 96, 1414869349),
(174, -1, 9, 0, 'How Storytelling affects the brain', '1- Neutral Coupling\r\nA story activates parts in the brain that allows the listener to turn the story in to their own ideas and experience thanks to a process called neutral coupling.\r\n2- Mirroring\r\nListeners will not only experience the similar brain activity to each other, but also to the speaker.\r\n3- Dopamine\r\nThe brain releases dopamine into the system when it experiences an emotionally-charged event, making it easier to remember and with greater accuracy.\r\n4- Cortex activity\r\nWhen processing facts, two areas of the brain are activated (Broca’s and Wernicke’s area). A well-told story can engage many additional areas, including the motor cortex, sensory cortex, and frontal cortex.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 97, 1414869646),
(175, -1, 21, 0, 'Precise and programmable biological circuits', 'A team led by ETH Professor Yaakov Benenson has developed several new components for biological circuits. These components are key building blocks for constructing precisely functioning and programmable bio-computers.', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', 'image.imageformat.fullwidth.1412909748.png', 'active', 98, 1414872845),
(176, -1, 15, 0, '3D  Printing in education', 'Tomorrow’s engineers, designers and problem solvers deserve every tool available to build a brilliant future. 3D printing fuels limitless creativity when students get to see, hold and test their ideas in real space.\r\nBringing 3D printing into the classroom exposes learners to the same cutting-edge technologies they’ll encounter in their careers. It gives them a jump-start on tomorrow’s challenges\r\n- See more at: http://www.stratasys.com/industries/education#sthash.QgIFppwY.dpuf', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '3d_printing.png', 'active', 99, 1414873026),
