(188, -1, 19, 0, 'How to study for a career in nanotechnology', 'Students often ask me for advice on how to study for a career in nanotechnology, and as you might imagine, providing a good answer is challenging. “Nanotechnology” refers to a notoriously broad range of areas of science and technology, and progress during a student’s career will open new areas, and some are yet to be imagined\r\n\r\n\r\n\r\nhttp://metamodern.com/2010/02/24/how-to-study-for-a-career-in-nanotechnology/', '1', '0000-00-00 00:00:00', '', '', '', '0000-00-00', '', 'active', 111, 1415114987),
