(215, 30, 19, 0, 'Videos on Nonotechnology', 'In this video Prof. Warren Chan, from the Institute of Biomaterials and Biomedical Engineering at the University of Toronto, discusses his work designing nanoparticles to deliver drugs specifically to tumor sites. Warren explains the advantages of using therapeutic nanoparticles for the treatment of cancer and tells Select Science about the technologies that are enabling this research', '1', '0000-00-00 00:00:00', '', 'http://www.selectscience.net/SelectScience-TV/Videos/prof-warren-chan,-university-of-toronto--nanotechnology-approaches-to-the-treatment-of-cancer/?&amp;videoID=1465', '', '0000-00-00', '', 'active', 137, 1416428517),
