(217, 43, 25, 0, 'High School Initiative', 'High School Initiative\r\nColleges and universities often find that many students could benefit from taking a few extra courses to help close the readiness gap between high school and college. To address this need, we launched the edX high school initiative –a collection of new online courses, including resources for preparation for Advanced Placement (AP*) exams and high school level courses in a variety of subject areas.\r\nGet College Ready with over 40 High School and AP* Exam Preparation Courses \r\nCovering subject areas ranging from mathematics to science, English and history, the edX high school initiative will provide students around the world who don’t have access to AP exam preparation courses the opportunity to pursue challenging, advanced coursework. These courses will better prepare high school students for college and offer learners of all ages an introduction to new areas of study and disciplines. Students can use the courses to prepare for college and the AP exams or to supplement AP coursework.\r\nTeachers can also use the new high school course materials to augment their classroom curriculum. \r\nA generous grant from the Laura and John Arnold Foundation, along with grants from the Wertheimer Fund and Fariborz Maseeh / The Massiah Foundation, are helping to fund edX’s high school initiative. \r\nedX Members:\r\n•	Boston University\r\n•	Georgetown University\r\n•	MIT\r\n•	Rice University\r\n•	TU Delft\r\n•	UC Berkeley\r\n•	Universidad Carlos III de Madrid\r\n•	UT Arlington\r\n•	UT Austin\r\n•	Wellesley College\r\n•	Davidson College', '1', '0000-00-00 00:00:00', '', 'https://www.edx.org/high-school-initiative', '', '0000-00-00', 'high-school-960x195.jpg', 'active', 139, 1416832030),
