(648, 59, 0, 59, 'تعزيز تواصلنا معكم وتفعيل خدماتنا المدرسية', 'حضرة أولياء الأمور والتلاميذ الكرام في القسم الثانوي،\r\nفي إطار تعزيز تواصلنا معكم وتفعيل خدماتنا المدرسية عبر استخدام تكنولوجيا المعلومات، يسرنا إعلامكم بأن المدرسة اعتمدت تطبيقاً إلكترونياً على الهواتف الذكية يمكنكم من خلاله الإطلاع على رسائلنا وتعاميمنا ولاحقاً الحصول على معلومات تتعلق بالدروس وبالفروض المنزلية وبالتحصيل الدراسي العام للتلميذ وصور مدرسية، هذا بالإضافة إلى معلومات علمية وثقافية تقوم بنشرها تباعاً عبر هذا التطبيق مجلة علم وعالم من أجل إتاحة الفرصة أمام تلاميذنا للإطلاع على المستجدات العلمية بصورة يومية.', '', '2015-02-19 08:02:00', '', '', '', '0000-00-00', 'NEW_2.jpg', 'active', 573, 1424325936),
