(63, 'I.S.A.M', 'تطبيق بريفيجين هو التطبيق الوحيد في العالم الذي يحتوي على شبكة اعلامية متخصصة للطلاب والمعلمين وهي  الشبكة  الاكاديمية العلمية الاعلامية  العالمية \r\n    The International Science Academic Media Network ، وهي المنصة الاعلامية الوحيدة من نوعها في العالم التي تربط المدارس ، والجامعات ، ومراكز الابحاث ، وعلماء العالم ، والشركات التكنولوجية الكبيرة ، ببعضها البعض عبر تطبيق بريفيجن الهاتفي وذلك للوصول الى الطلاب حول العالم لبناء العقول التي تشكل الرأسمال الاهم لاقتصادات المعرفة  .\r\nهذه الشبكة على تطبيق بريفيجين تسمح للطلاب من الفئة العمرية  7 الى 12 سنة بمتابعة الاخبار المصورة والمقالات المختصرة وقصص العلماء  والفيديوهات التعليمية، بلغة مبسطة تساعدهم على توسيع فهمهم لمناهجهم التعليمية وايجاد الروابط بينها وبين ما يختبرونه في الحياة ....\r\nوتتوجه الشبكة  الى الفئة العمرية من الثالثة عشرة الى الثامنة عشرة  باسلوب شامل لتحضيرهم للمرحلة الجامعية اللاحقة بما يضمن لهم معرفة واسعة ومفصّلة بالاختصاصات التي ستتحتاجها أسواق العمل المستقبلية ، وذلك من خلال اخبار الابحاث العلمية ،والمقالات المتخصصة ،والمقابلات مع الاساتذة الجامعيين والعلماء من الجامعات المختلفة حول العالم .\r\nوللمرة الاولى فى العالم سيتابع الطلاب والمعلمون  مقابلات حصرية   فيديو او مكتوبة ومترجمة الى اللغات العربية ، السويدية، الايطالية، الالمانية،الفرنسية ، والانكليزية  مع مئات العلماء في الدول العربية ، الولايات المتحدة الاميركية ، اوروبا ، كندا ، اوستراليا ، االيابان، الصين ،كوريا الجنوبية ،كما سيتاح المجال لطرح الاسئلة من الطلاب والمعلمين من خلال خدمة الفيديو وتلقي الاجوبة من المختصين والعلماء من حول العالم بالفيديو ايضا.', 'majdi@pre.com', '81dc9bdb52d04dc20036dbd8313ed055', '', '', '', 'maj', 'saad', 'maj saad', '', '', '', 0, '0000-00-00', '', '0000-00-00', '', 'active', 49, 1423824239, '', 0, 0),
