INSERT INTO `site_news` (`id`, `news_cat_id`, `title`, `description`, `text`, `link`, `date`, `image`, `status`, `rank`, `time`) VALUES
(51, 0, 'Does vitamine C fight cancer?', 'Vitamin C is found in many vegetables and fruits, especially \r\noranges, grapefruits, and peppers. Many studies have shown a \r\nlink between eating foods rich in vitamin C, such as fruits and vegetables, and a reduced risk of cancer. On the other hand, the \r\nfew studies in which vitamin C has been given as a supplement \r\nhave not shown a reduced cancer risk.', '', '', '2014-06-03', '1.jpg', 'active', 2, 1401793616),
(52, 0, 'Sugar Danger', 'Fructose Sugar: This Addictive Commonly Used Food, Feeds Cancer \r\nCells, Triggers Weight Gain, and Promotes Premature Aging.', '', '', '2014-06-03', '9.jpg', 'active', 3, 1401793616),
(50, 0, 'Etiquette for children', 'Excuse Me   This is a valuable phrase that is used too little. Besides saying \r\n“excuse me” after public bodily functions there are many other times when \r\n“excuse me” should be used. Such as when a person walks through a \r\ncrowded room, bumps into someone, walks in front of someone, needs to \r\nleave a group, or needs to ask a question.', '', '', '2014-06-03', '6.jpg', 'active', 1, 1401793616);
